import React from "react";
import "./EmailPopup.css"; // Import the CSS file

function EmailPopup() {
  return (
    <div className="email-popup"> {/* Apply CSS class */}
      <img
        src="/images/emailpopup/email-popup.png"
        className="email-popup-image" 
        alt="Email Popup"
      />
      <img
        src="/images/emailpopup/email-popup-button.png"
        className="email-signup-button" 
        alt="Email Signup Button"
      />
    </div>
  );
}

export default EmailPopup;
